import android.content.Context
import android.database.sqlite.SQLiteDatabase
import android.database.sqlite.SQLiteOpenHelper


class DBHelper(context: Context) : SQLiteOpenHelper(context, "baseproyecto.db", null, 1) {

    override fun onCreate(db: SQLiteDatabase?) {
        // Crear tabla Productos
        val query1 = """
        CREATE TABLE Productos (
            ID_Producto INTEGER PRIMARY KEY AUTOINCREMENT,
            Nombre TEXT NOT NULL,
            Artista TEXT NOT NULL,
            Precio DOUBLE NOT NULL,
            Descripcion TEXT,
            Imagen TEXT
        );
        """

        // La cadena Base64 que tienes de la imagen
        val imgVessel = ""
        val imgGNX= ""
        val imgTNA=""
        val imgCircles=""
        val imgCMIYGL=""
        val imgFutureNostalgia=""
        val imgVeintiuno=""
        val imgKoK=""
        val imgAnti= ""
        val imgIZ=""

        // Consulta de insercin con la imagen en formato Base64
        val query2 = """
        INSERT INTO Productos (Nombre, Artista, Precio, Descripcion, Imagen)
        VALUES 
        ('Vessel', 'Twenty One Pilots', 299.99, 'Explora las profundidades de la mente humana con una fusin de indie pop, rap y rock.', '$imgVessel'),
        ('GNX', 'Kendrick Lamar', 349.99, 'Una obra maestra del hip-hop moderno, que combina letras introspectivas y una produccin sonora nica.', '$imgGNX'),
        ('The New Abnormal', 'The Strokes', 379.99, 'Un regreso brillante para la banda, con sonidos frescos y letras cargadas de melancola.', '$imgTNA'),
        ('Circles', 'Mac Miller', 319.99, 'lbum pstumo profundamente personal que combina elementos de hip-hop y jazz.', '$imgCircles'),
        ('Call Me If You Get Lost', 'Tyler, The Creator', 399.99, 'Un lbum conceptual vibrante que transporta a los oyentes a un viaje sonoro lleno de creatividad.', '$imgCMIYGL'),
        ('Future Nostalgia', 'Dua Lipa', 399.99, 'Un lbum pop con un toque retro y futurista, lleno de himnos bailables y vibrantes.', '$imgFutureNostalgia'),
        ('21', 'Adele', 349.99, 'La obra maestra que captur corazones, con baladas cargadas de emocin y una voz incomparable.', '$imgVeintiuno'),
        ('King of Kings', 'Don Omar', 299.99, 'Un lbum icnico que marc un hito en el reguetn con letras profundas y ritmos pegajosos.', '$imgKoK'),
        ('Anti (Deluxe)', 'Rihanna', 379.99, 'Una fusin audaz de gneros que destaca la versatilidad artstica de Rihanna.', '$imgAnti'),
        ('In the Zone', 'Britney Spears', 319.99, 'Un disco innovador que mezcla pop, electrnica y R&B, mostrando una nueva faceta de Britney.', '$imgIZ');
        """

        // Ejecutar las consultas
        db?.execSQL(query1)
        db?.execSQL(query2)
    }

    override fun onUpgrade(db: SQLiteDatabase?, oldVersion: Int, newVersion: Int) {
        // Modificaciones cuando se actualice la app
    }

    data class Producto(
        val id: Int, // Agregado el campo id
        val nombre: String,
        val artista: String,
        val precio: Double,
        val descripcion: String,
        val imagenBase64: String? = null // Si hay una imagen en base64
    )

    fun getAllProductos(): List<Producto> {
        val productos = mutableListOf<Producto>()
        val db = this.readableDatabase
        val cursor = db.rawQuery("SELECT * FROM Productos", null)

        if (cursor.moveToFirst()) {
            do {
                val id = cursor.getInt(cursor.getColumnIndexOrThrow("ID_Producto")) // Asegrate de obtener el ID del producto
                val nombre = cursor.getString(cursor.getColumnIndexOrThrow("Nombre"))
                val artista = cursor.getString(cursor.getColumnIndexOrThrow("Artista")) // Asegrate de obtener el artista
                val precio = cursor.getDouble(cursor.getColumnIndexOrThrow("Precio"))
                val descripcion = cursor.getString(cursor.getColumnIndexOrThrow("Descripcion"))
                val imagen = cursor.getString(cursor.getColumnIndexOrThrow("Imagen"))

                // Crear el objeto Producto con los campos obtenidos
                productos.add(Producto(id, nombre, artista, precio, descripcion, imagen))
            } while (cursor.moveToNext())
        }
        cursor.close()
        return productos
    }

}